    render(){
        return(
            <div className="main container-fluid">
            <div class="row ">
            <div class="col-12  d-flex flex-row">
                <LeftSide/>
                <Login className="col-6 loginArea"/>
                <Register className="col-6 loginArea"/>
            </div>
            </div>
            </div>
        )
    }
}

export default MainPage;
